 * <ui5-link href="https://sap.github.io/ui5-webcomponents/playground/components/RangeSlider" target="_blank">UI5 Web Components Playground</ui5-link>
 */
const RangeSlider = withWebComponent('ui5-range-slider', ['endValue', 'startValue', 'accessibleName', 'labelInterval', 'max', 'min', 'step'], ['disabled', 'showTickmarks', 'showTooltip'], [], ['change', 'input']);
RangeSlider.displayName = 'RangeSlider';
RangeSlider.defaultProps = {
    endValue: 100,
    startValue: 0,
    labelInterval: 0,
    max: 100,
